import { useState } from "react";
import { useNavigate } from "react-router-dom";

function Signup() {
    const nav = useNavigate();
    const [newuser,setnew]=useState({
        email:"",
        password:"",
        cpassword:""
    })
    const changeval=(event)=>{
        var tempname = event.target.name
        var tempvalue = event.target.value
        setnew({
            ...newuser,
            [tempname]:tempvalue
        })
    }
    const handlesubmit=async (event)=>{
        var email=newuser.email
        var password=newuser.password
        event.preventDefault();
        if(newuser.password===newuser.cpassword)
        {
            const res = await fetch('http://localhost:5001/signup',{
                method:'POST',
                headers:{'Content-type':'application/json'},
                body:JSON.stringify({email,password})
            })
            const json=await res.json();
            console.log(json)
            if(res.ok)
            {
                alert("succesfuly signed up")
                setnew({
                    email:"",
                    password:"",
                    cpassword:""
                })
                nav('/')
            }
            else{
                alert(json.error)
            }
        }
        else{
            alert("Passwords do not match")
        }
    }
    return ( <div>
        <section class="bg-gray-50 dark:bg-gray-900">
            <div class="flex flex-col items-center justify-center px-6 py-8 mx-auto md:h-screen lg:py-0">
                <div class="w-full bg-white rounded-lg shadow dark:border md:mt-0 sm:max-w-md xl:p-0 dark:bg-gray-800 dark:border-gray-700">
                    <div class="p-6 space-y-4 md:space-y-6 sm:p-8">
                        <h1 class="text-xl font-bold leading-tight tracking-tight text-gray-900 md:text-2xl dark:text-white">
                            Sign up to join us
                        </h1>
                        <form class="space-y-4 md:space-y-6" onSubmit={handlesubmit} >
                            <div>
                                <label  class="block mb-2 text-sm font-medium text-gray-900 dark:text-white">Your email</label>
                                <input type="email" onChange={changeval} value={newuser.email} name="email" id="email" class="bg-gray-50 border border-gray-300 text-gray-900 sm:text-sm rounded-lg focus:ring-red-600 focus:border-red-600 block w-full p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500" placeholder="name@company.com" required="" />
                            </div>
                            <div>
                                <label  class="block mb-2 text-sm font-medium text-gray-900 dark:text-white">Password</label>
                                <input type="password" onChange={changeval} value={newuser.password} name="password" id="password" placeholder="••••••••" class="bg-gray-50 border border-gray-300 text-gray-900 sm:text-sm rounded-lg focus:ring-red-600 focus:border-red-600 block w-full p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500" required="" />
                            </div>
                            <div>
                                <label  class="block mb-2 text-sm font-medium text-gray-900 dark:text-white">Confirm Password</label>
                                <input type="password" onChange={changeval} value={newuser.cpassword} name="cpassword" id="password" placeholder="••••••••" class="bg-gray-50 border border-gray-300 text-gray-900 sm:text-sm rounded-lg focus:ring-red-600 focus:border-red-600 block w-full p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500" required="" />
                            </div>
                            <div class="my-4 flex items-center before:mt-0.5 before:flex-1 before:border-t before:border-neutral-300 after:mt-0.5 after:flex-1 after:border-t after:border-neutral-300">

                            </div>
                            <button type="submit" class="w-full text-white bg-red-600 hover:bg-red-700 focus:ring-4 focus:outline-none focus:ring-red-300 font-medium rounded-lg text-sm px-5 py-2.5 text-center dark:bg-blue-500 dark:hover:bg-red-700 dark:focus:ring-red-800">Sign up</button>
                            <p class="text-sm font-light text-gray-500 dark:text-gray-400">
                                Already have an account ? <a href="/login" class="font-medium text-red-600 hover:underline dark:text-red-500">Sign in</a>
                            </p>
                        </form>
                    </div>
                </div>
            </div>
        </section>
    </div> );
}

export default Signup;
